import './App.css';
import React from 'react';
import Header from './components/Header';
import Nav from './components/Nav';
import Main from './components/Main';
import Footer from './components/Footer';

const HeaderNav = () => {
  return (
    <div className="header-nav-container">
      <Header />
      <Nav />
    </div>
  );
};

function App() {
  return (
<>
<HeaderNav />
<Main />
<Footer />
</>
  );
}

export default App;
